import React from 'react'
import "./Leftsidebar.css";

function Leftsidebar() {
    return (
        <nav>
            <ul>
                <li><a href="#">London</a></li>
                <li><a href="#">Paris</a></li>
                <li><a href="#">Tokyo</a></li>
            </ul>
        </nav>
    )
}
export default Leftsidebar
